import React from 'react'
import Menu from '../Component/Menu';
import RecupStream from '../Component/Stream';
import footer from '../Img/footer.png'
import {
    Link
} from "react-router-dom";


function Connexion() {
    return (
        <div>
            <input
                style={{ width: '90%', fontWeight: 'bold', borderRadius: 5, margin: 10, height: 30 }}
                placeholder={"LOGIN"}
            />
            <input
                style={{ width: '90%', fontWeight: 'bold', borderRadius: 5, margin: 10, height: 30 }}
                placeholder={"MOT DE PASSE"}
            />
            <div style={{ margin: '1.5%', borderColor: '#440BD4', backgroundColor: '#440BD4', borderWidth: 2, borderStyle: 'solid', borderRadius: 5, padding: 5, paddingTop: 3 }}>
                <Link style={{ color: 'white', textDecoration: 'none', fontWeight: 'bold', fontSize: '75%' }} >SUBMIT</Link>
            </div>
        </div>
    );
}

export default Connexion;
